import './signin.css';
import logo from '../../assets/logo.png'

function SignIn() {
  return (
    <div className='container'>
      <div>
        <div className='login'>
          <div className='logo'>
            <img src={logo} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
